import React,{ useState } from 'react';
import { Link } from 'react-router-dom';



import './style.css';


export default function Home(){
    const [counter, setCounter] = useState(0);
    const [counter1, setCounter1] = useState(0)
    const [counter2, setCounter2] = useState(0);
    const [counter3, setCounter3] = useState(0);
    const [counter4, setCounter4] = useState(0);
    const [counter5, setCounter5] = useState(0);
    
    return (
            <div className="container-flex">
                <div className="card-albert">
                    <span className="cientName">Albert E.</span><br/>
                    <span className="votos">Contagem de votos: {counter}</span>
                    <button className="button" onClick={() => setCounter(counter + 1)}>Votar</button>
                </div>

                <div className="card-copernico">
                    <span className="cientName">Nicolau Copernico</span><br/>
                    <span className="votos">Contagem de votos: {counter1}</span>
                    <button className="button" onClick={() => setCounter1(counter1 + 1)}>Votar</button>
                </div>

                <div className="card-marie">
                    <span className="cientName">Marie Curie</span><br/>
                    <span className="votos">Contagem de votos: {counter2}</span>
                    <button className="button" onClick={() => setCounter2(counter2 + 1)}>Votar</button>
                </div>

                <div className="card-newton">
                    <span className="cientName">Isaac Newton</span><br/>
                    <span className="votos">Contagem de votos: {counter3}</span>
                    <button className="button" onClick={() => setCounter3(counter3 + 1)}>Votar</button>
                </div>
                <div className="card-null">
                    <span className="otherName">Nulo</span>
                    <span className="votosNW">Contagem de votos: {counter4}</span>
                    <button className="button" onClick={() => setCounter4(counter4 + 1)}>Votar</button>
                </div>
                
                <div className="card-white">
                    <span className="otherName">Branco</span>
                    <span className="votosNW">Contagem de votos: {counter5}</span>
                    <button className="button" onClick={() => setCounter5(counter5 + 1)}>Votar</button>
                </div>
            </div>
        


        
    );
};
